import { Form, Formik } from "formik";
import React from "react";
import { FormikControl } from "../../../formik/FormikControl_AddItems";
import { SubmitBtn } from "../../../formik/SubmitBtn";

export const AddNewColor = () => {
  return (
    <div className="modal-content">
      <Formik>
        {(formik) => {
          //console.log(formik);
          return (
            <Form>
              {/* ==============  modal-header ============= */}
              <div className="modal-header">
                <h1 className=" w-100 fs-5" id="staticBackdropLabel">
                  اضافه کردن گارانتی جدید
                </h1>
              </div>
              {/* ==============  modal-body ============== */}
              <div className="pt-3">
                {/* <FormikControl
                          control="input"
                          type="text"
                          name="title"
                          placeholder="عنوان"
                        />

                        <FormikControl
                          control="textArea"
                          type="textArea"
                          name="descriptions"
                          placeholder="توضیحات"
                        /> */}
                <div className="row">
                  <div className="col-7 ">
                    {/* <FormikControl
                              control="input"
                              type="number"
                              name="length"
                              placeholder="مدت گارانتی"
                            /> */}
                  </div>
                  <div className="col-5 d-flex align-items-center">
                    {/* <FormikControl
                              control="radio"
                              type="radio"
                              name="length_unit"
                              placeholder="برحسب:"
                            /> */}
                  </div>
                </div>
              </div>
              <div className="text-center">
                <SubmitBtn />
              </div>
            </Form>
          );
        }}
      </Formik>
    </div>
  );
};
